SECURITY_METADATA_OGTITLE:"Discord Security Bug Bounty",SECURITY_METADATA_DESCRIPTION:"As part of our commitment to security, we reward security researchers for reporting security vulnerabilities responsibly to us. Found a security vulnerability? Submit it here.",SECURITY_HERO_CALLOUT:"Learn More",SECURITY_SUBMIT_VULNERABILITY:"Submit a Vulnerability",SECURITY_INTRO_TITLE:"Discord Security Bug Bounty",SECURITY_INTRO_DESCRIPTION:"At Discord, we take privacy and security very seriously. As such, we encourage everyone to participate in our open bug bounty program, which incentivizes researchers and hackers alike to responsibly find, disclose, and help us resolve security vulnerabilities. As with many bug bounties out there, Discord has a fairly straightforward and simple set of rules that help protect both us and those looking to disclose. Thanks for participating and happy bug hunting!",SECURITY_APPROACH_TITLE:"How we approach security issues",
SECURITY_APPROACH_LINE_1:"Discord will not take legal action against users for disclosing vulnerabilities as instructed here.",SECURITY_APPROACH_LINE_2:"Vulnerability reports will always be responded to as fast as possible—usually within 24 hours.",SECURITY_APPROACH_LINE_3:"Based on the validity, severity, and scope of each issue, we'll reward you with awesome shtuff (or just cold, hard cash if you prefer).",SECURITY_RULES_TITLE:"Program Rules",SECURITY_RULES_LINE_1:"Only use and test on accounts and servers you directly own. Testing should never affect other users.",SECURITY_RULES_LINE_2:"Testing should be limited to sites and services that Discord directly operates. We will not accept reports for third-party services or providers that integrate with Discord through our APIs.",
SECURITY_RULES_LINE_3:"Don't perform any actions that could harm the reliability or integrity of our services and data. Some examples of harmful activities that are not permitted under this bounty include: brute forcing, denial of service (DoS), spamming, timing attacks, etc.",SECURITY_RULES_LINE_4:"Don't use scanners or automated tools to find vulnerabilities.",SECURITY_RULES_LINE_5:"No information about issues found should be publicly disclosed or shared until we've completed our investigation and resolution. After confirmation, you are free to document and publish any information about the issues you've found in accordance with HackerOne's [disclosure guidelines](https://www.hackerone.com/disclosure-guidelines).",
SECURITY_RULES_LINE_6:"If a specific class of vulnerability crops up regularly, we may temporarily mark it Out of Scope while we look to make a solution internally before re-allowing that issue. In these cases, we will update the policy and communicate the change to all current researchers along with a rough expected timeline. Once the internal solution is in place, we will update the policy and communicate the re-allowance.",SECURITY_SPECIAL_TITLE:"Special Vulnerabilities",SECURITY_SPECIAL_SUBTITLE:"These areas have a more granular scope or have particular considerations prior to reporting.",SECURITY_OUT_OF_SCOPE_TITLE:"Out of Scope Vulnerabilities",SECURITY_OUT_OF_SCOPE_SUBTITLE:"When reporting vulnerabilities, please consider (1) attack scenario / exploitability, and (2) security impact of the bug. The following issues are generally considered out of scope (not an exhaustive list):",SECURITY_TEMPORARILY_OUT_OF_SCOPE_TITLE:"Temporarily Out of Scope Vulnerabilities",
SECURITY_SPECIAL_VULNERABILITIES:"Special Vulnerabilities",SECURITY_THIRD_PARTY_MARKETING_CAMPAIGNS:"Third Party Promotional or Marketing Campaigns",SECURITY_THIRD_PARTY_MARKETING_CAMPAIGNS_DESCRIPTION:"Third-party providers and partners are not in scope. Submissions against third-party promotional or marketing campaigns will not be accepted. Reports with a specific campaign that fail to demonstrate significant security impact or financial harm to Discord are not accepted. Reports against Discord features and APIs are generally in scope. Example out of scope issues:",SECURITY_ACTIVITIES_SCOPE_TITLE:"Activities Within the Discord Client",SECURITY_ACTIVITIES_DESCRIPTION:"Activities served by the Discord client may be first or third party services. The following list of first party Activities are in scope as part of the Discord platform:",
SECURITY_ACTIVITIES_EXCLUSIONS:"Any Activity not explicitly defined above is out of scope for this bug bounty program. Additionally the following are out of scope:",SECURITY_ACTIVITIES_PERMITTED_OVERRIDE:"We consider any situation in which a malicious user could steal tokens or credentials belonging to another user without the use of social engineering in the context of an Activity to be in scope for this program.",SECURITY_BEST_EFFORT_DEFENSES_TITLE:"Best Effort Defenses",SECURITY_BEST_EFFORT_DEFENSES_SUBTITLE:"Some areas are treated as best-effort protections. Complete compromise of these systems is still in-scope, but bypasses are generally out-of-scope.",SECURITY_THANKS_TITLE:"Special Thanks to:",SECURITY_CONTACT_US:"Contact us!",
SECURITY_PROGRAM_INVITE_INSTRUCTIONS:"Discord operates a bug bounty program in partnership with HackerOne. To join our bug bounty program please send an email with your report to [bugbounty@discordapp.com](mailto:bugbounty@discordapp.com). Please send your full report as the body of your email - do not send an email asking for an invitation. You will receive an email back from HackerOne with further instructions on how to create a HackerOne account and complete your report submission! Please note that the [bugbounty@discordapp.com](mailto:bugbounty@discordapp.com) email inbox is unattended - for the security team to review your report you must complete HackerOne registration and finalize your submission on the HackerOne platform.",SECURITY_REFRESH_METADATA_TITLE:"Security Bug Bounty | Discord",SECURITY_REFRESH_METADATA_DESCRIPTION:"As part of our commitment to security, we reward security researchers for reporting security vulnerabilities responsibly to us.",
